import React from 'react';
import './styles.css';
import {Link} from 'react-router-dom';

function Nav() {
	const navStyle = {
		color: 'white'
	};
	
	return (
		<nav>
			<h1>24/7 Recipes</h1>
			<ul className="container">
				<Link style={navStyle} to="/user">
					<li>User</li>
				</Link>
				<Link style={navStyle} to="/home">
					<li>Home</li>
				</Link>
			</ul>
		</nav>
	);
}

export default Nav;
